import Head from 'next/head';
import Layout from '../components/layout'
const about = () => {
    return (
        <Layout title="about">
            <Head>
                <title>about</title>
            </Head>
            <div>
                <h1>about</h1>
            
            </div>
        </Layout>
    );
};
export default about;
